background: var(--background);
border-radius:10px;


.content-dashboard{
    padding: 20px 40px;
    display: grid;
    grid-template-columns: 1fr 300px;
    padding-top: 70px;
}

p{
    margin:0;
}

.title{ 
        font-size: 18px;
        font-weight: 500;
}
`
export default function MainBaord() {
    return (
        <Component>
            <Navigation />
            <div className="content-dashboard">
                <OverView />
                {/* <WalletInfo /> */}
            </div>
        </Component>
    )
}
